;; gorilla-repl.fileformat = 1

;; **
;;; # Nodes and Links
;;; 
;;; This worksheet explores the entities and connections in the social news network.
;; **

;; @@
(ns gentle-brook
  (:refer-clojure :exclude [find sort])
  (:require [gorilla-plot.core :as plot]
            [gg4clj.core :as gg4clj]
            [monger.collection :as mc]
            [ceres-analytics.core :refer [db news-accounts nodes links]]
            [clojure.data.priority-map :refer [priority-map]]
            [clj-time.core :as t]
            [clj-time.periodic :as p]
            [incanter.stats :refer [mean]]
            [clj-time.format :as f]
            [monger.core :as mg]
            [monger.joda-time]
            [monger.operators :refer :all]
            [aprint.core :refer [aprint]]
            [monger.query :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; ## Nodes
;;; The basic entities in the network are *users*, *messages*, *urls* and *tags*.
;;; Overall count:
;; **

;; @@
(reduce + (map #(mc/count @db %)  nodes))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-long'>138086</span>","value":"138086"}
;; <=

;; **
;;; ### Distribution
;; **

;; @@
(let [dat {:nodes nodes
           :counts (map #(mc/count @db %) nodes)}]
  (gg4clj/view
    [[:<- :d (gg4clj/data-frame dat)]
     (gg4clj/r+
       [:ggplot :d [:aes :nodes :counts]]
       [:geom_bar {:stat "identity" :fill "steelblue"}]
       [:xlab "Entity"]
       [:ylab "Counts"]
       [:ggtitle "Entity distribution"])]
    {:width 10
     :height 6}))
;; @@
