;;; ## Post Time Analytics
;; **

;; @@
(let [post-counts (->> (mc/find-maps @db "messages")
                      (map (fn [{:keys [ts]}] (t/day ts)))
                      frequencies
                      (sort-by first <))
      dat {:days (map first post-counts)
           :counts (map second post-counts)}]
  (gg4clj/view
    [[:<- :d (gg4clj/data-frame dat)]
     (gg4clj/r+
       [:ggplot :d [:aes :days :counts]]
       [:geom_line {:stat "identity" :color "steelblue"}]
       [:geom_point {:color "steelblue"}]
       [:xlab "Day"]
       [:ylab "Counts"]
       [:ggtitle "Day distribution"])]
    {:width 10
     :height 6}))
