;; <=

;; @@
(let [news-users (map :_id (mc/find-maps @db "users" {:name {$in news-accounts}}))
      news-counts (->> (mc/find-maps @db "pubs" {:source {$in news-users}})
                      (map (fn [{:keys [ts]}] (t/hour ts)))
                      frequencies
                      (sort-by first <))
      other-counts (->> (mc/find-maps @db "pubs" {:source {$nin news-users}})
                      (map (fn [{:keys [ts]}] (t/hour ts)))
                      frequencies
                      (sort-by first <))
      dat {:hours (map first (concat news-counts other-counts))
           :counts (map second (concat news-counts other-counts))
           :type (into (take (count other-counts) (repeat "user")) (take (count news-counts) (repeat "source")))}]
  (gg4clj/view
    [[:<- :d (gg4clj/data-frame dat)]
     (gg4clj/r+
       [:ggplot :d [:aes :hours :counts {:group :type :color :type}]]
       [:geom_line {:stat "identity"}]
       [:geom_point]
       [:xlab "Hour"]
       [:ylab "Counts"]
       [:ggtitle "Day distribution"])]
    {:width 10
     :height 6})
  )
