;; @@
(let [users (mc/find-maps @db "users" {:name {$in news-accounts}})
      dat {:sources (map :name users)
       :counts (map #(mc/count @db "pubs" {:source (:_id %)}) users)}]
    (gg4clj/view
    [[:<- :d (gg4clj/data-frame dat)]
     (gg4clj/r+
       [:ggplot :d [:aes :sources :counts]]
       [:geom_bar {:stat "identity" :fill "steelblue"}]
       [:xlab "Source"]
       [:ylab "Counts"]
       [:ggtitle "Source distribution"])]
    {:width 10
     :height 6}))
